import React, { useState, useEffect } from "react";
import { fetchTasks, fetchTaskById, updateTask, deleteTask } from "./api";
import TaskForm from "./components/TaskForm";
import { Button, Typography, Container } from "@mui/material";
import SideMenu from "./components/SideMenu";
import { useTranslation } from 'react-i18next'; // Importing translation hook
import "./index.css";
import './i18next';

const App = () => {
  const { i18n } = useTranslation(); // Translation hook for handling language changes
  const [tasks, setTasks] = useState([]);
  const [taskToEdit, setTaskToEdit] = useState(null);
  const [lang, setLang] = useState("en");
  const [menuOpen, setMenuOpen] = useState(false);

  // Fetch tasks on component mount
  useEffect(() => {
    const getTasks = async () => {
      const data = await fetchTasks();
      setTasks(data);
    };
    getTasks();
  }, []);

  // Update task list after a new task is created
  const handleTaskCreated = () => {
    const getTasks = async () => {
      const data = await fetchTasks();
      setTasks(data);
    };
    getTasks();
  };

  // Fetch task details for editing
  const handleTaskEdit = async (taskId) => {
    try {
      const task = await fetchTaskById(taskId);
      setTaskToEdit(task); // Set the task to be edited
    } catch (error) {
      console.error("Error fetching task for editing:", error);
    }
  };

  // Clear editing state after task is edited
  const handleEditComplete = () => {
    setTaskToEdit(null);
  };

  // Update task status
  const handleStatusChange = async (taskId, status) => {
    const updatedTask = tasks.find((task) => task.id === taskId);
    if (updatedTask) {
      updatedTask.status = status;
      await updateTask(updatedTask);
      const data = await fetchTasks();
      setTasks(data);
    }
  };

  // Delete a task
  const handleDeleteTask = async (id) => {
    await deleteTask(id);
    const data = await fetchTasks();
    setTasks(data);
  };

  // Toggle between English and Arabic
  const toggleLanguage = () => {
    const newLang = lang === "en" ? "ar" : "en";
    setLang(newLang);
    i18n.changeLanguage(newLang); // Change language using i18n
    document.body.dir = newLang === "ar" ? "rtl" : "ltr"; // Adjust text direction
  };

  // Toggle side menu
  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <Container maxWidth="sm" className="app-container">
      <SideMenu menuOpen={menuOpen} toggleMenu={toggleMenu} toggleLanguage={toggleLanguage} lang={lang} />

      {/* Application title */}
      <Typography variant="h4" gutterBottom>{i18n.t('taskManagement')}</Typography>

      {/* Language toggle button */}
      <Button onClick={toggleLanguage} variant="contained" color="primary">
        {lang === "en" ? "Switch to Arabic" : "التبديل إلى الإنجليزية"}
      </Button>

      {/* Task Form Component */}
      <TaskForm 
        onTaskCreated={handleTaskCreated} 
        taskToEdit={taskToEdit} 
        onEditComplete={handleEditComplete} 
      />

      {/* List of tasks */}
      <div className="task-list">
        {tasks.map((task) => (
          <div key={task.id} className="task-item">
            <Typography variant="h6">{task.title}</Typography>
            <Typography variant="body1">{task.description}</Typography>
            <Typography variant="body2">{i18n.t('dueDate')}: {task.dueDate}</Typography>
            <Typography variant="body2">{i18n.t('status')}: {task.status}</Typography>

            <div className="task-actions">
              <Button
                variant="contained"
                color="primary"
                onClick={() => handleTaskEdit(task.id)}
                style={{ backgroundColor: '#4A628A', marginRight: '10px' }}
              >
                {i18n.t('edit')}
              </Button>
              <Button
                variant="contained"
                color="secondary"
                onClick={() => handleDeleteTask(task.id)}
                style={{ backgroundColor: '#4A628A' }}
              >
                {i18n.t('delete')}
              </Button>
            </div>
          </div>
        ))}
      </div>
    </Container>
  );
};

export default App;
